import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../../../styles/Life11.css"; // Importando o arquivo de estilos

const Life11 = () => {
  const [dados, setDados] = useState(null);

  useEffect(() => {
    // Simula√ß√£o dos dados extra√≠dos do Excel
    const dadosFII = {
      dataAtualizacao: "12/03/2025",
      pl: 374356700, // Patrim√¥nio L√≠quido
      quantidadeCotas: 37901307,
      valorCota: 9.877145,
      variacaoCota: 0.003207,
      caixa: 100,
      cnpj: "01.234.567/0001-89",
      administrador: "V√≥rtx",
      cotaAjustada: 14.877145
    };
    
    setDados(dadosFII);
  }, []);

  return (
    <div className="life11-container">
      <h2 className="life11-title">Fundos Imobili√°rios - LIFE11</h2>

      {dados ? (
        <table className="life11-table">
          <thead>
            <tr>
              <th>Data de Atualiza√ß√£o</th>
              <th>PL (R$)</th>
              <th>Quantidade de Cotas</th>
              <th>Valor da Cota (R$)</th>
              <th>Varia√ß√£o da Cota (%)</th>
              <th>Caixa (R$)</th>
              <th>CNPJ</th>
              <th>Administrador</th>
              <th>Cota Ajustada (R$)</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td data-label="Data de Atualiza√ß√£o">{dados.dataAtualizacao}</td>
              <td data-label="PL (R$)">{dados.pl.toLocaleString("pt-BR")}</td>
              <td data-label="Quantidade de Cotas">{dados.quantidadeCotas.toLocaleString("pt-BR")}</td>
              <td data-label="Valor da Cota (R$)">{dados.valorCota.toFixed(5)}</td>
              <td data-label="Varia√ß√£o da Cota (%)">{(dados.variacaoCota * 100).toFixed(5)}%</td>
              <td data-label="Caixa (R$)">{dados.caixa.toLocaleString("pt-BR")}</td>
              <td data-label="CNPJ">{dados.cnpj}</td>
              <td data-label="Administrador">{dados.administrador}</td>
              <td data-label="Cota Ajustada (R$)">{dados.cotaAjustada.toFixed(5)}</td>
            </tr>
          </tbody>
        </table>
      ) : (
        <p className="life11-loading">Carregando dados...</p>
      )}

      {/* üìå Bot√£o abaixo da tabela */}
      <div className="button-container">
        <Link to="/fundos/life11/carteira" className="carteira-btn">
          Carteira e Indicadores
        </Link>
      </div>
    </div>
  );
};

export default Life11;
